import "./Sidebar.css";
import React from "react";

const Sidebar = ({}) => {
  return (
    <>
      <Col>
              <Row><a>Projects Summary</a></Row>
              <Row><a>Education</a></Row>
              <Row><a>Experience</a></Row>
              <Row><a>Skills</a></Row>
              <Row><a>Achievements</a></Row>
            </Col>
    </>
  );
};

export default Sidebar;
